        hover: {
         opacity:0.6,
          y: -15,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
      
      const logoMotion = {
        rest: { opacity: 1,y:20, duration:0.8, type: "tween", ease: "easeIn" },
        hover: {
          opacity: 0,
          y:-30,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
      const headingMotion = {
        rest: { opacity: 0.6,y:30, ease: "easeOut", duration: 0.2, type: "tween" },
        hover: {
          opacity: 1,
          y:-20,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }}
    return (
        <IconContext.Provider value={{ color: "blue", size:'60' }}>

        <Main>
           <MainGrid>
